import Company from '../company/Company';

import {
    getSpredSheet,
} from "../company/companySlice";


const Search = () => {
    const [info, setInfo] = useState({})
    const getSpredSheet = async() => {
        Tabletop.init({
            key: '1iQhGbFVfEGXLVzrsbxKi-SwVsXkDWI_XyrrFok8rTdk',
            callback: googleData => {
              console.log('google sheet data --->', googleData);
              setInfo(googleData)
            },
        })
    }

