        Tabletop.init({
            key: '1iQhGbFVfEGXLVzrsbxKi-SwVsXkDWI_XyrrFok8rTdk',
        })
          .then((data) => setInfo(data))
    }, []);

    return (
        <div>
            {info.シート1.elements.name}
        </div>
    )
}

export default Search
